// Series definition

// item identifier

export * from './line';
export * from './bar';
export * from './scatter';
export * from './pie';
// Helpers

export function isDefaultizedBarSeries(series) {
  return series.type === 'bar';
}
export function isBarSeries(series) {
  return series.type === 'bar';
}
